import React, { useState } from 'react';
import { registerReceptionist } from '../../api/endpoints';

const RegisterReceptionist = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    phone: ''
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await registerReceptionist(formData);
      alert('Receptionist registered successfully');
      setFormData({ name: '', email: '', password: '', phone: '' });
    } catch (error) {
      alert('Registration failed');
    }
  };

  return (
    <div className="register-receptionist">
      <h2>Register Receptionist</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Name"
          value={formData.name}
          onChange={(e) => setFormData({...formData, name: e.target.value})}
          required
        />
        <input
          type="email"
          placeholder="Email"
          value={formData.email}
          onChange={(e) => setFormData({...formData, email: e.target.value})}
          required
        />
        <input
          type="password"
          placeholder="Password"
          value={formData.password}
          onChange={(e) => setFormData({...formData, password: e.target.value})}
          required
        />
        <input
          type="tel"
          placeholder="Phone"
          value={formData.phone}
          onChange={(e) => setFormData({...formData, phone: e.target.value})}
          required
        />
        <button type="submit">Register Receptionist</button>
      </form>
    </div>
  );
};

export default RegisterReceptionist;
